const mapSuggestedNovels = state => {
    return {SuggestedNovels: state.SuggestedNovels};
}

const mapSelectedTranslationNovels = state => {
    return {novels: state.SelectedTranslationNovels};
}

const mapUpdatedNovels = state => {
    return {novels: state.UpdatedNovels};
}

const mapFullNovels = state => {
    return {novels: state.FullNovels};
}

const mapShortNovels = state => {
    return {novels: state.ShortNovels};
}

const ProcessData = {mapSuggestedNovels, mapSelectedTranslationNovels, mapUpdatedNovels, mapFullNovels, mapShortNovels};

export default ProcessData;
